    **I restructured the folder system of the DLC. Please delete the "/Cars" folder located in "Barroco Hispano DLCs/Vehicles DLC/Automobile" and replace it with the new version.**


    **You can find images and info of what this DLC contains here:**


    **Specs:**


    You can find the vehicles in the props section.


    **I will update this DLC constantly so you must be on the lookout.**


    **Scale of the models:** **133% on all axes.**


    **Installation:**


    **If you downloaded my "AGC - Cars DLC" please delete the following folder with its content: Barroco Hispano DLCs/AGC/United Kingdom DLC/**


    **Unzip the "Barroco Hispano DLCs" in your Plugins Folder (I highly recommend respecting my folder system because I plan to export or update thousands of BATs).**


    **Now you can make voluntary contributions to support me in continuing to create more content for SimCity 4 (I decided to use Paypal instead of Patreon because I want everyone to have access to my
    content). ![*:thumb:](https://community.simtropolis.com/assets/emoticons/default_44.gif "*:thumb:")**


    https://www.paypal.com/donate/?hosted_button_id=WF9FDNHXCHDVU


    **Thanks to the few people who have donated to me.**
